import React from 'react';
import './styles/App.css';
import { Button } from 'semantic-ui-react'

function App() {
  return (
    <div>
      Vania
      <i class="fas fa-phone-square-alt"></i>
      <Button>Click Here</Button>
      <Icon disabled name='mail' />
    </div>
  );
}

export default App;
